// src/pages/Logs.jsx
import React, { useEffect, useState } from 'react'
import { getLogs } from '../services/api'

const Logs = () => {
  const [logs, setLogs] = useState([])
  const role = localStorage.getItem('role') // 'Admin' veya 'User'

  useEffect(() => {
    if (role === 'Admin') {
      getLogs().then(res => setLogs(res.data))
    }
  }, [role])

  if (role !== 'Admin') {
    return <div className="p-6 text-red-600 font-semibold">Yetkiniz yok</div>
  }

  return (
    <div className="p-6">
      <h2 className="text-xl font-bold mb-4">Loglar</h2>
      <table className="w-full border">
        <thead>
          <tr className="bg-gray-200">
            <th className="p-2">Kullanıcı</th>
            <th className="p-2">İşlem</th>
            <th className="p-2">Tarih</th>
          </tr>
        </thead>
        <tbody>
          {logs.map(log => (
            <tr key={log.id} className="border-t">
              <td className="p-2">{log.username}</td>
              <td className="p-2">{log.type}</td>
              <td className="p-2">{log.createdDate}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  )
}

export default Logs
